import React from "react";

const AdminDashboard = () => {
  return (
    <div style={{ padding: "20px" }}>
      <h1>Admin Dashboard</h1>
      <p>Upload photos, create albums, and manage client content here.</p>
    </div>
  );
};

export default AdminDashboard;
